import Link from 'next/link'

const SideBar = () => {
    return (
        <div className="menu">
            <div className="logo"><img src="/images/newLogoWhite.svg"/></div>
            <div className="menu-item">
               <Link href="/" as="/search">Search</Link> 
            </div>

            <style jsx>{`
                .menu {
                    display: flex;
                    flex-direction: column;
                    position: relative;
                    height: 100%;
                    width: 100%;
                    padding: 10px;
                    background: #281742;
                }

                .menu-item {
                    padding: 5px;
                    color: #785999;
                    cursor: pointer;
                    font-size: 15px;
                }

                .menu-item:hover {
                    background: #9482a3;
                    border-radius: 4px;
                    // font-weight: bold;
                    color: white;
                }

                .logo {
                    margin-bottom: 100px;
                    width: 50%;
                    align-self: center;
                }

                .logo img {
                    width: 100%;
                }

                menu-item a {
                    color: white;
                }
            `}</style>
        </div>
    )
}

export default SideBar
